    label: 'Medium',
    icon: 'MediumIcon',
    href:
      '/',
  },
  {
    label: 'Github',
    icon: 'GithubIcon',
    href:
        '/',
  },
  {
    label: 'Contracts',
    icon: 'MoreIcon',
    items: [
      {
        label: 'JAZZ token',
        href: '/',
      },
      {
        label: 'Masterchef token',
        href: '/',
      },
      {
        label: 'Timelock token',
        href: '/',
      },
      {
        label: 'Liquidity lock',
        href: '/',
      },
    ],
  },
]

export default config
